    } else {
      /*  let token = req.headers.authorization || "";
      token = token.replace("Bearer ", "");
      const user = await userGet(token); */
      return { models };
    }
  },
});

server.listen({ port: process.env.PORT || 4000 }).then(({ url }) => {
  console.log(`ðŸš€  Server ready at ${url}`);
});

